body.script:
$(document).ready(function() {
    if (document.cookie.indexOf('cookie_notice') >= 0) { // se tiver o cookie
    } else { // se nao tiver o cookie
        var date = new Date();
        date.setTime(date.getTime() + (30 * 24 * 60 * 60 * 1000));
        var expires = "; expires=" + date.toGMTString();

        document.cookie = "cookie_notice" + "=" + '1' + expires + "; path=/";

        $('.cookieNotice').fadeIn();

        $('.cookieNoticeClose').click(function(e) {
            e.preventDefault();
            $('.cookieNotice').fadeOut();
        })
    }
})

